import React from 'react'
import { useState } from 'react';
import './Body.css';
import Welcome from './Welcome.tsx';
import Overview from './Overview.tsx';
type props = {
  displayHelper : boolean,
}
//const [displayHelper, setHelperDisplay] = useState(false);
function Body({displayHelper} : props) {
  

  function handleHelperDisplay(): void {
    if (displayHelper === false)
      displayHelper = true
    else
      displayHelper = false
    console.log(displayHelper);
  const props = {
    handleHelperDisplay : handleHelperDisplay()
  }

 }
  return (
    <div className="Body">
      <Welcome {...props}></Welcome>
      <Overview></Overview>
    </div>
  );
}

export default Body;
